import React from 'react';
import MediaQuery from 'react-responsive';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import theme from '../theme/theme';
// import Button from '@material-ui/core/Button';
// import Grid from '@material-ui/core/Grid';
import logo from '../images/logo.png';



export default function App () {

    return (
        // <AppBar color="paper" positionsticky="true">
        // <Toolbar>

            // <div align="center">
            //     <img src={logo} alt="Website Logo" width="75%"/>

            //     <Grid container direction="row" justify="space-evenly" alignItems="center">
            //         <Button color="grey">Projects</Button>
            //         <Button color="inherit" >Experience</Button>
            //         <Button color="inherit" >Education</Button>
            //         <Button color="inherit" >About</Button>
            //         <Button color="inherit" >Contact</Button>
            //     </Grid>
            // </div>

        // </Toolbar>
        // </AppBar>


    <div>
        <AppBar color="paper" positionsticky="true">
            <Toolbar>
                <MediaQuery maxWidth={theme.breakpoints.values.iPhone678Plus}>
                    <div align="left">
                        <img src={logo} alt="Website Logo" width="80%"/>

                    </div>
                </MediaQuery>


                <MediaQuery minWidth={theme.breakpoints.values.iPad}>
                    <h1>Aucoin</h1>
                </MediaQuery>
            </Toolbar>
        </ AppBar>
    </div>
    )
}
